import banner from '../images/banner.png'

const Nav = () => {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    return (
        <div>
            <img src={banner} alt='Home button' width={'90px'}/>
            <nav>
                <ul>
                    <li>Measurement</li>
                    <li>Matter #38 Change</li>
                </ul>
            </nav>
        </div>
    );
};

export default Nav;
